const INITIAL_STATE = {
    list:[]
}
export default (state = INITIAL_STATE, action) =>{
    switch(action.type){
        case 'ADD_ITEM':
            var list = INITIAL_STATE.list.push(action.data)
            console.log("o que vem no list")
           return action.data
        default:
            return state
    }
}
